import Banner from './componentes/Banner';
import Formulario from './componentes/Formulario';
import ListaSuspensa from './componentes/ListaSuspensa';

const times = [
  'Programação',
  'Front-End',
  'Data-Science',
  'Devops',
  'UX e Design',
  'Mobile',
  'Inovação e Gestão'
]

function App() {
  return (
    <div className="App">
      <Banner />
      <Formulario />
      <ListaSuspensa itens={times}/>
    </div>
  );
}

export default App;
